//root
#include <TH1D.h>
#include <TStyle.h>
#include <TString.h>
#include <TCanvas.h>
#include <TFile.h>
#include <TTree.h>

//C, C++
#include <stdio.h>
#include <assert.h>
#include <stdlib.h>
#include <iostream>
#include <fstream>
#include <string>
#include <iomanip>

using namespace std;

void convBunchDataUSB2root(TString dataFileList, TString datPreff, TString rootFileN);

int main(int argc, char *argv[] ){

  if(argc == 4){
    TString dataFileList = argv[1];
    TString datPreff = argv[2];
    TString rootFileN = argv[3];
    cout<<endl
	<<"       File containing the list of input data files: "<<dataFileList<<endl
	<<" Path of the directory containing these input files: "<<datPreff<<endl
	<<"                       Name of the output ROOT file: "<<rootFileN<<endl<<endl;
    convBunchDataUSB2root( dataFileList, datPreff, rootFileN);
  }
  else{
    cout<<endl
	<<"  ERROR ---> in input arguments "<<endl
	<<"             [1] : name of a text file containing the list of USBWC files to be converted to ROOT"<<endl
	<<"             [2] : path of the directory containing the input USBWC files"<<endl
	<<"             [3] : name of the output ROOT file"<<endl;
  }

  return 0;
}

void convBunchDataUSB2root(TString dataFileList, 
			   TString datPreff, 
			   TString rootFileN){

  //USBWC data in one ev//
  Int_t _eventID;
  Float_t _SamplingPeriod;
  Int_t _INLCorrection;
  Int_t _FCR;
  Double_t _UnixTime;
  Float_t _ch[16][256];
  Float_t _Charge[16], charge;
  Float_t _Time[16], time;
  Float_t _Amplitude[16], amplitude;
  Int_t _boardEVENTID[16], boardEVENTID;
  ///////////////////////

  ///////////////////Root file with data/////////////////
  TFile *hfile = new TFile( rootFileN, "RECREATE", "USBWC Data", 1);
  if (hfile->IsZombie()) {
    cout << "PROBLEM with the initialization of the output ROOT ntuple " 
	 << rootFileN << ": check that the path is correct!!!"
	 << endl;
    exit(-1);
  }
  TTree *tree = new TTree("T", "USBWC Data Tree");
  hfile->SetCompressionLevel(2);
  tree->SetAutoSave(1000000);
  // Create new event
  TTree::SetBranchStyle(0);

  //Event USBWC
  tree->Branch("eventID",&_eventID, "eventID/I");
  tree->Branch("SamplingPeriod", &_SamplingPeriod,  "SamplingPeriod/F");
  tree->Branch("INLCorrection", &_INLCorrection,  "INLCorrection/I");
  tree->Branch("FCR", &_FCR,  "FCR/I");
  tree->Branch("UnixTime",&_UnixTime, "UnixTime/D");
  tree->Branch("ch", _ch, "ch[16][256]/F");
  tree->Branch("Charge", _Charge, "Charge[16]/F");
  tree->Branch("Time", _Time, "Time[16]/F");
  tree->Branch("Amplitude", _Amplitude, "Amplitude[16]/F");
  ///////////////////////////////////////////////////////

  Int_t i = 0;
  Int_t j = 0;
  string mot;
  Double_t amplVal;
  Int_t chID = 0;

  Int_t nEv = 0;
  Int_t nEv_Tot = 0;

  Int_t dataStructureID = -999;
  
  Double_t timeNpevEv = -999.0;

  // Will make sure that events are correctly read from the ASCII file
  Bool_t newEventShouldFollow;

  // Init event variables
  _eventID = -999;
  _SamplingPeriod = -999.0;
  _INLCorrection = -999;
  _FCR = -999;
  _UnixTime = -999.0;
  for(j = 0;j<16;j++){
    _Charge[j] = -1E20;
    _Time[j] = -999.0;
    _Amplitude[j] = -999.0;
    for(i = 0;i<256;i++){
      _ch[j][i] = -999.0;
    }
  }

  ifstream indataFileUSB;
  string dataFileName;
  TString fileN;
  TString rootF;
  indataFileUSB.open(dataFileList.Data()); 
  assert(indataFileUSB.is_open());  
  while (indataFileUSB  >> dataFileName ){
    fileN = datPreff + "/" + dataFileName;
    if(indataFileUSB.eof()){
      std::cout<<"EOF"<<std::endl;
      break;
    }
    cout
      //<<endl<<endl
      <<"\t * Converting ---> "<<fileN<<endl;
    //<<"          to  "<<rootFileN<<endl;

    /////////////////////////////
    ifstream indata;
    indata.open(fileN.Data()); 
    assert(indata.is_open());
    nEv = 0; // Event counter for a given file
    newEventShouldFollow = kTRUE;
    while (indata  >> mot ){
      //cout<<" New word: "<<mot<<endl;
      
      // Example of line decoded below
      // === EVENT 1 === FULLY ORDERED DATA [256 samples] in Volts === NB OF WAVECAT BOARDS = 8 ===
      if(mot == "EVENT"){
	assert( newEventShouldFollow == kTRUE );
	newEventShouldFollow = kFALSE;
	nEv++;
	indata  >> _eventID;
	//cout<<"_eventID "<<_eventID<<endl;
      }    
      
      // Example of line decoded below
      // Sampling Period = 312.5 ps, INL Correction: YES 
      if(mot == "Sampling"){
	indata >> mot;
	if(mot == "Period"){
	  //cout<<mot<<endl;
	  indata >> mot;
	  indata >> _SamplingPeriod;
	  //cout<<" _SamplingPeriod "<<_SamplingPeriod<<endl;
	} // Period
      } // Sampling     
      if(mot == "INL"){
	indata  >> mot;
	if(mot == "Correction:"){
	  indata  >> mot;
	  if(mot == "YES"){
	    _INLCorrection = 1;
	  }
	  if(mot == "NO"){
	    _INLCorrection = 0;
	  }
	} // Correction
	//cout<<" _INLCorrection "<<_INLCorrection<<endl;
      } // INL

      // Skip line below for now:
      // == BOARD V5.6 FCR = 217 ==
      if( mot == "BOARD" ) {
	indata >> mot; // V5.6
	indata >> mot; // FCR
	if(mot != "FCR"){
	  cout<<"mot != FCR"<<endl
	      <<"wrong DATA format"<<endl;
	  assert(0);
	}
	indata >> mot; // =
	indata >> mot; // 217
	indata >> mot; // EVENTID or BOARD
	//LB + NA
	//there are 5 possible formats for the data
	//the new data format (25.01.2011) has information about eventID number in the board.
	// dataStructureID = 0 (not implemented for very old format without time charge and amplitude)
	// dataStructureID = 1  == BOARD V5.6 FCR = 217 == (FCR presented 2 time per boards per event September-October runs)  
	// dataStructureID = 1  == BOARD V5.6 FCR = 217 == (FCR presented 1 time per boards per event)  
        // dataStructureID = 2: == BOARD V5.6 FCR = 168  BOARD GAIN = 1.0 ==
        // dataStructureID = 3: == BOARD V5.6 FCR = 184 EVENTID = 0 BOARD GAIN = 1.0 ==
	if(mot == "EVENTID"){
	  indata >> mot; // =
	  indata >> boardEVENTID;
	  indata >> mot;//BOARD
	  indata >> mot;//GAIN
	  indata >> mot;//= 
	  indata >> mot;//1.0 
	  indata >> mot;//==
	  dataStructureID = 3;
	}
	else if(mot == "BOARD"){
	  dataStructureID = 2;
	}
	else if(mot == "=="){
	  dataStructureID = 1;
	}
	else{
	  cout<<" ERROR --> unknown data structure "<<endl;
	  assert(0);
	}
      }
      
      // Field FCR only present in the September-October runs
      // Keep it in the ntuple to avoid compatibility problems
      /*
      // Example of line decoded below
      // FCR = 4713980, UnixTime = 1288036061.845, date = 2010.10.25, time = 12h.47m.41s.845ms 
      if(mot == "FCR"){
	indata  >> mot;
	indata  >> _FCR;
	//cout <<" _FCR "<<_FCR<<endl;	  
      } // FCR
      */
      // Example of line decoded below
      //UnixTime = 1288632257.224 date = 2010.11.1 time = 10h.24m.17s.224ms
      if(mot == "UnixTime"){
	indata  >> mot;
	indata  >> _UnixTime;
	//printf("UnixTime: %20.4f \n", _UnixTime);
	if(timeNpevEv != -999.0 && (_UnixTime - timeNpevEv)<0.0){
	  cout<<endl<<" events (files) in data list are not ordered in time:"<<endl;
	  printf("\t * previous unix time: %20.4f \n", timeNpevEv);
	  printf("\t *  current unix time: %20.4f \n", _UnixTime);
	  assert(0);
	}
	timeNpevEv = _UnixTime;
      }
      
      // Example of snippet decoded below
      //== CHANNEL : 0  Charge: 4508.108 pC Time: -1.000 ns Amplitude: -0.478980 V==
      // followed by the 256 points of the corresponding waveform
      if(mot == "CHANNEL"){
	indata  >> mot;
	indata  >> chID;
	
	if( chID < 0 || chID > 15){
	  cout<<"chID = " << chID << " should be between 0 and 15!"<<endl;
	  assert(0);
	}
	
	///////////////
	//Charge:
	indata  >> mot;
	assert( mot == "Charge:" );
	indata  >> charge;
	indata  >> mot;
	
	//Time
	indata  >> mot;
	assert( mot == "Time:" );
	indata  >> time;
	indata  >> mot;
	
	//Amplitude
	indata  >> mot;
	assert( mot == "Amplitude:" );
	indata  >> amplitude;
	indata  >> mot;
	///////////////

	//LB
	//dataStructureID -- identification number of the data structure (DS)
	//dataStructureID == 2 --> correspond to the DS with eventID 
	//                         from the board to avoid mixing of the data 
	if(dataStructureID == 3){
	  if(boardEVENTID >=0 && boardEVENTID<=255){
	    _boardEVENTID[chID] = boardEVENTID;
	  }
	  else{
	    cout<<" ERROR ---> boardEVENTID>=0 && boardEVENTID<=255"<<endl
		<<"            boardEVENTID = "<<boardEVENTID<<endl;
	    assert(0);
	  }
	}
	else if(dataStructureID == 2 || dataStructureID == 1){
	  _boardEVENTID[chID] = -999;
	}
	//cout<<"boardEVENTID    = "<<boardEVENTID<<endl
	//  <<"dataStructureID = "<<dataStructureID<<endl;
	
	_Charge[chID]    = charge;
	_Time[chID]      = time;
	_Amplitude[chID] = amplitude;
	
	/*
	cout<<" chID  "<< chID
	    <<": charge = " << charge
	    << " time = " << time
	    << " amplitude = " << amplitude
	    << endl;
	*/

	for(i = 0;i<256;i++){
	  indata  >> amplVal;
	  //if(amplVal> 0.3){
	  //cout<<"amplVal   "<<amplVal<<endl
	  //    <<"eventID = "<<_eventID<<endl;
	  //}
	  
	  _ch[chID][i] = amplVal;
	}
	
	//cout << "chID = " << chID << " i = " << i << endl;
	if(chID == 15 && i == 256){	
	  // Event is finished, time to fill the tree
	  // First, make rough checks to see if data have been read correctly...
	  Bool_t checksOK = kTRUE;
	  if( -999 ==_eventID ) { 
	    cout << "_eventID = " << _eventID << " is bad!" << endl;
	    checksOK = false; 
	  }
	  if( _SamplingPeriod < 0 ) { 
	    cout << "_SamplingPeriod = " << _SamplingPeriod << " is bad!" << endl;
	    checksOK = false; 
	  }
	  if( -999 == _INLCorrection ) { 
	    cout << "_INLCorrection = " << _INLCorrection << " is bad!" << endl;
	    checksOK = false; 
	  }
	  // 2010/11/01: FCR check now irrelevant as this
	  // variable is no more present in the USBWC data files
	  /*
	  if( -999 == _FCR ) { 
	    cout << "_FCR = " << _FCR << " is bad!" << endl;
	    checksOK = false; 
	  }
	  */
	  if( _UnixTime < 1200000000 ) { 
	    cout << "_UnixTime = " << _UnixTime << " is bad!" << endl;
	    checksOK = false; 
	  }
	  for(j = 0;j<16;j++){
	    if( _Charge[j] < -1E19 ) { 
	      cout << "_Charge[" << j << "] = " << _Charge[j] << " is bad!" << endl;
	      checksOK = false; 
	    }
	    if( _Time[j] == -999.0 ) { 
	      cout << "_Time[" << j << "] = " << _Time[j] << " is bad!" << endl;
	      checksOK = false; 
	    }
	    if( _Amplitude[j] < -900 ) { 
	      cout << "_Amplitude[" << j << "] = " << _Amplitude[j] << " is bad!" << endl;
	      checksOK = false; 
	    }
	    for(int ii = 0;ii<256;ii++){
	      if( _ch[j][ii] < -900 ) { 
		cout << "_ch[" << j << "][" << ii << "] = " 
		     << _ch[j][ii] << " is bad!" << endl;
		checksOK = false; 
	      }
	    }
	  }
	  if( checksOK ) {
	    //cout << "Fill the tree" << endl;
	    tree->Fill();
	  } else {
	    cout << "Problems with the data format of event " 
		 << _eventID << " => it is not included in the ROOT file"
		 << endl;
	  }
	  newEventShouldFollow = kTRUE; // One should start a new event next
	  // Init event variables in preparation for the next event
	  _eventID = -999;
	  _SamplingPeriod = -999.0;
	  _INLCorrection = -999;
	  _FCR = -999;
	  _UnixTime = -999.0;
	  boardEVENTID = -999;
	  for(j = 0;j<16;j++){
	    _Charge[j] = -1E10;
	    _Time[j] = -999.0;
	    _Amplitude[j] = -999.0;
	    _boardEVENTID[j] = -999;
	    for(int iii = 0;iii<256;iii++){
	      _ch[j][iii] = -999.0;
	    }
	  }
	  //if(_eventID%500==0)
	  //cout<<"eventID = "<<_eventID<<endl;	    
	}
      } // if(mot == "CHANNEL"){
      
      ///////////////////////    
    } // while (indata  >> mot ){
    //cout<<" close "<<endl;
    indata.close();
    nEv_Tot += nEv; // Add the number of events read in file indata
    cout << "\t   " << nEv << " events added to the ROOT tree" << endl; 
    
    /////////////////////////////
  }
  indataFileUSB.close();
  hfile = tree->GetCurrentFile();
  hfile->Write();

  hfile->Close();

  // Make the output ROOT file rw by the group
  TString cmd = "chmod g+rw " + rootFileN;
  //cout << "Executing command " << cmd << endl;
  system( cmd.Data() );

  cout<<"============================"<<endl;
  cout<<"Total number of events read:"<<endl;
  cout<<"nEv_Tot = "<<nEv_Tot<<endl;
  cout<<"============================"<<endl;  
}


